// private apiUrl = 'http://localhost:5000/api/books';\n\n  private apiUrl = `${environment.baseUrl}/books`;\n\n  constructor(private http: HttpClient) { }\n\n  getBooks(page: number): Observable {\n    return this.http.get(`${this.apiUrl}?page=${page}`);\n  }\n\n  getBook(id: string): Observable {\n    return this.http.get(`${this.apiUrl}/${id}`);\n  }\n\n  createBook(book: FormData): Observable {\n    const headers = new HttpHeaders({\n      Authorization: 'Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY0MzI5YmE2YzY0MDBmMzc0NzVmNDEwOSIsImlhdCI6MTY4MTA4NTY1NywiZXhwIjoxNjgzNjc3NjU3fQ.A8T54Y__MVpmCEFpqeMF5ILSPzT3XrP1Oee4Y-H6RzA',\n    });\n    return this.http.post(`${this.apiUrl}`, book,{\n      headers\n    });\n  }\n\n  updateBook(id: string, book: FormData): Observable {\n    const headers = new HttpHeaders({\n      Authorization: 'Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY0MzI5YmE2YzY0MDBmMzc0NzVmNDEwOSIsImlhdCI6MTY4MTA4NTY1NywiZXhwIjoxNjgzNjc3NjU3fQ.A8T54Y__MVpmCEFpqeMF5ILSPzT3XrP1Oee4Y-H6RzA',\n    });\n    return this.http.put(`${this.apiUrl}/${id}`, book,{\n      headers\n    });\n  }\n\n  deleteBook(id: string): Observable {\n    return this.http.delete(`${this.apiUrl}/${id}`);\n  }\n\n  getPopularBooks(): Observable {\n    return this.http.get(`${baseUrl}/api/authors/popular/books/popular`);\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/BookShelfComponent.html":{"url":"components/BookShelfComponent.html","title":"component - BookShelfComponent","body":"\n                   \n\n\n\n\n\n  Components\n  \n  BookShelfComponent\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n        \n            Template\n        \n        \n            Styles\n        \n        \n            DOM Tree\n        \n\n\n\n    \n    File\n\n\n    src/app/components/book-shelf/book-shelf.c